Description !
-----------------------
How to get more likes and followers on Instagram?
ATTENTION: We higly suggest to upgrade to latest version!
This is an Instagram auto-like tool, it is very useful if you want to like pictures in your favourite tags, sessions, contests, groups or simply with your friends.
Simply write one or more tags (max 40) in the format: #snow #cute #flowers
Autolikestagram will get the &quot;most recent images&quot; (max 20 per tag) and will auto-like each picture skipping pictures present in two or more tags.
In this way more people will come to visit your profile and you'll get more Visitors, more Likes and more Followers ;-)
Attention !!!
If you liked 100 pics and skipped 30 it is possible that into the 100 pics there ae some you already liked in past. For this reason the real liked pics visible from the Instagram official app can be eg.: 60, because only one like is accepted per picture.
Repeat procedure some times using different tags!
Remember autolikestagram will skip pictures only in the current session.

